import { useState } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';

let exampleData = [
  {
    title: 'topic one',
    timeEstimate: 5,
    textDescription: 'this is topic 1 description',
  },
  {
    title: 'topic2',
    timeEstimate: 10,
    textDescription: 'this is topic 2 description',
  },
  {
    title: 'topic3',
    timeEstimate: 15,
    textDescription:
      'this is topic 3 description blabdlabdlbwa ahwjkdh awjhd awjwdh hwajk dwja dhwja dwhaj dawj',
  },
];
function App() {
  const [agendaData, setAgendaData] = useState(exampleData);

  return (
    <div id='App'>
      <div id='agenda__container'>
        <h2>Agenda Plan</h2>
        {agendaData.map((elm, index) => {
          return (
            <div className='agenda-topic__container' key={elm.title + index}>
              <h4 style={{ gridColumnStart: 'col1' }}>{elm.title}</h4>
              <p style={{ textAlign: 'center', color: '#5a585C' }}>
                {elm.timeEstimate + 'mins'}
              </p>
              <p>{elm.textDescription}</p>
              {/* <button type="button" class="btn btn-light btn-sm">Edit</button> */}

              <DropdownButton
                bsStyle='default'
                // title='Edit'
                noCaret
                // size='sm'
                id='dropdown'
                variant='Secondary'
              >
                <Dropdown.Item eventKey='1'>Action</Dropdown.Item>
                <Dropdown.Item eventKey='2'>Another action</Dropdown.Item>
              </DropdownButton>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default App;
